/* crop and resize the image to model's input size */
void cropNResize(Mat& img, Mat& result, int frame_w, int frame_h){
    auto w = img.size[1], h = img.size[0]; // type int
    auto target_len = min(w, h);
    auto start_x = (w-target_len)/2, start_y = (h-target_len)/2;
    Mat cropped = img(Range(start_y, start_y+target_len), Range(start_x, start_x+target_len));
    Mat resized;
    resize(cropped, result, Size(frame_w, frame_h));
}

void renderBox(string windowName, Mat image, Point topLeft, Point botRight){

    //arguments: image: which image to draw on, top left of the box, bottom right of the box, colour, thickness
    rectangle(image, topLeft, botRight, Scalar(0, 0, 255), 2);
    //Display the image in the window:
    imshow(windowName, image);
    //Wait for a keyboard event and handle it:
    waitKey(0);
    //Destroy the window and release resources:
    destroyWindow(windowName);
}
    
// Function to apply the sigmoid function to a vector
vector<double> sigmoid(const vector<double>& input, double mean, double step) {
    vector<double> output;
    for (const auto& value : input) {
        double sigmoid_value = 1.0 / (1.0 + exp(-((value - mean) * step)));
        output.push_back(sigmoid_value);
    }
    return output;
}

// Function to reshape a 1D vector to a 2D vector
vector<vector<double>> reshapeTo2D(const vector<double>& input, int rows, int cols) {
    vector<vector<double>> output(rows, vector<double>(cols, 0.0));
    int index = 0;
    for (int i = 0; i < rows; ++i) {
        for (int j = 0; j < cols; ++j) {
            output[i][j] = input[index++];
        }
    }

    return output;
}

// Extract (x,y) coordinates, width, and height of the current data from dequant_box and resize it. 
tuple<double, double, double, double> getbox(const vector<double>& input, int region_id) {
    double x_center, y_center, w, h;
    double prior_x = box_prior[1 * RESULT_NUM + region_id];
    double prior_y = box_prior[0 * RESULT_NUM + region_id];
    double prior_w = box_prior[3 * RESULT_NUM + region_id];
    double prior_h = box_prior[2 * RESULT_NUM + region_id];

    y_center = input[0] / Y_SCALE * prior_h + prior_y;
    x_center = input[1] / X_SCALE * prior_w + prior_x;
    h = exp(input[2] / H_SCALE) * prior_h;
    w = exp(input[3] / W_SCALE) * prior_w;

    return make_tuple(x_center - w / 2, y_center - h / 2, w, h);
}

tuple<tuple<double, double, double, double>, bool> clip_window(const tuple<double, double, double, double> data) {
    tuple<double, double, double, double> emptyTuple;
    //check if the tuple is empty
    if (data == emptyTuple) {
        return make_tuple(make_tuple(-1, -1, -1, -1), true);
    }

    double wx1 = 0, wx2 = 300, wy1 = 0, wy2 = 300;
    double bx1 = get<0>(data);
    double by1 = get<1>(data);
    double bx2 = get<0>(data) + get<2>(data);
    double by2 = get<1>(data) + get<3>(data);

    if (bx1 < wx1) {
        bx1 = wx1;
    }
    if (bx2 < wx1) {
        bx2 = wx1;
    }
    if (bx1 > wx2) {
        bx1 = wx2;
    }
    if (bx2 > wx2) {
        bx2 = wx2;
    }
    if (by1 < wy1) {
        by1 = wy1;
    }
    if (by2 < wy1) {
        by2 = wy1;
    }
    if (by1 > wy2) {
        by1 = wy2;
    }
    if (by2 > wy2) {
        by2 = wy2;
    }
    tuple<double, double, double, double> newdata;
    newdata = make_tuple(bx1, by1, bx2 - bx1, by2 - by1);

    // If bounding box area is too small, set invalid to true.
    bool invalid = false;
    if (get<2>(newdata)* get<3>(newdata) < 0.1) {
        invalid = true;
    }

    return make_tuple(newdata, invalid);
}

bool compareByThirdElement(const tuple<int, int, double, bool>& a, const tuple<int, int, double, bool>& b) {
    // Compare the third elements of the tuples in descending order.
    return get<2>(a) > get<2>(b);
}

void sortClassboxlist(vector<vector<tuple<int, int, double, bool>>>& classboxlist, int k) {
    // Sort the k-th row (vector) based on the third element of each tuple in descending order.
    sort(classboxlist[k].begin(), classboxlist[k].end(), compareByThirdElement);
}

bool IS_VALID_RECT(tuple<double, double, double, double>& bbox){
    return (get<2>(bbox) > 0.0 && get<3>(bbox) > 0.0);
}

double RECT_AREA(tuple<double, double, double, double>& bbox){
    return get<2>(bbox)*get<3>(bbox);
}

double get_iou( tuple<double, double, double, double>& box_a, tuple<double, double, double, double>& box_b){
    tuple<double, double, double, double> overlap;
    get<0>(overlap) = max(get<0>(box_a), get<0>(box_b));
    get<1>(overlap) = max(get<1>(box_a), get<1>(box_b));
    get<2>(overlap) = min(get<0>(box_a) + get<2>(box_a), get<0>(box_b) + get<2>(box_b)) - get<0>(overlap);
    get<3>(overlap) = min(get<1>(box_a) + get<3>(box_a), get<1>(box_b) + get<3>(box_b)) - get<1>(overlap);
    if (!IS_VALID_RECT(overlap))
        return 0.0;
    return RECT_AREA(overlap) / RECT_AREA(box_a) + RECT_AREA(box_b) - RECT_AREA(overlap);
}

int NMS_byclass(vector<tuple<int, int, double, bool>>& classboxlist, vector<bool>& boxlist,
                int classid, int current_id, vector<tuple<double, double, double, double>>& boxes)
{

    if (get<1>(classboxlist[current_id]) != classid)
        return -1;
    
    int curid = current_id;
    int next_item = -1;
    int boxid;
    int curboxid;
    // Loop through and skip if info does not match parameters (invalid, less than min confidence or IoU threshold, etc.).
    for (int i = curid + 1; i < RESULT_NUM; i++){
        if (get<3>(classboxlist[i]))
            continue;
        if (get<2>(classboxlist[i]) < MIN_CONFIDENCE)
            continue;
        boxid = get<0>(classboxlist[i]);
        curboxid = get<0>(classboxlist[curid]);
        if (boxlist[boxid])
            continue;
        if (get<1>(classboxlist[i]) == classid && get_iou(boxes[boxid], boxes[curboxid]) > IOU_THRESHOLD)
            continue;
        if (next_item < 0)
            next_item = i;
    }

    return next_item;
}

bool resultbox_compare(const tuple<int, int, double, bool>& a, const tuple<int, int, double, bool>& b) {
    if (get<3>(a) == false) {
        if (get<3>(b) == false) {
            return false;
        } else {
            return true;
        }
    }
    if (get<3>(b) == false) {
        return false;
    }
    return get<2>(a) < get<2>(b);
}

int main(void){
    /* edit model & test img path here: */
    string model_path = "./../dla_models/mobilenet_ssd_pascal_quant.dla";
    string test_img_path = "./../stand.jpeg";
    int frame_w = 300, frame_h = 300;

    /* initialize objects */
    auto model = neuropl::Model(model_path);
    Mat img = imread(test_img_path);
    Mat img_RGB;
    namedWindow("Image");
    cropNResize(img, img_RGB, frame_w, frame_h);

    /* predict */
    auto pred_result = model.predict(img_RGB.ptr());

    /* print raw result */
    // printf("output count: %lu \n", size(pred_result));
    //printf("output sizes: %lu, %lu \n", size(pred_result[0]), size(pred_result[1]));

    /* process result */
    vector out0 = pred_result[0], out1 = pred_result[1]; // extract the two outputs
    // convert vector to type  double
    vector<double> out0_double(out0.begin(), out0.end());
    vector<double> out1_double(out1.begin(), out1.end());
    vector<double> result0 = sigmoid(out0_double, DEQUANT_CLASS_MEAN, DEQUANT_CLASS_STEP);
    vector<double> result1;
    for (size_t i = 0; i < out1_double.size(); ++i) {
       result1.push_back((out1_double[i] - DEQUANT_BBOX_MEAN) * DEQUANT_BBOX_STEP);
    }

    auto dequant_class = reshapeTo2D(result0, 1917, 21);
    vector<double> dequant_box = result1;
    vector<tuple<double, double, double, double>> boxdata(1917, make_tuple(-1, -1, -1, -1));
    vector<vector<tuple<int, int, double, bool>>> classboxlist(21, vector<tuple<int, int, double, bool>>(1917, make_tuple(-1, -1, -1.0, false)));
    vector<tuple<int, int, double, bool>> classresultlist(ALL_RESULT_SIZE, make_tuple(-1, -1, -1.0, false));
    vector<bool> invalidindexes(1917, false);

    // Extract bounding box and confidence values as well as detect whether the data is invalid for all data points.
    for (int i = 0; i < 1917; i++){
        vector<double> dequant_sliced(next(dequant_box.begin(), i*4), next(dequant_box.begin(), i*4+4));
        boxdata[i] = getbox(dequant_sliced, i);
        // Confidences stores the confidence that the current data matches each of the 21 classes.
        vector<double> confidences(next(dequant_class[i].begin(), 1), next(dequant_class[i].begin(), 21));
        // Populate classboxlist with the confidences list and set invalid to True if the data is below MIN_CONFIDENCE.
        int cnt = 1;
        for (size_t x = 0; x < confidences.size(); x++){
            if (confidences[x] < MIN_CONFIDENCE)
                classboxlist[cnt][i] = make_tuple( i, cnt, -1, true);
            else
                classboxlist[cnt][i] = make_tuple( i, cnt, confidences[x], false);
            cnt++;
        }

        // If the bounding box coordinates of the current data exceed image dimensions, clip the lines to the edge of the image. If the bounding box is too tiny, add it to invalidindexes.
        auto clip_window_output = clip_window(boxdata[i]);
        boxdata[i] = get<0>(clip_window_output);
        invalidindexes[i] = get<1>(clip_window_output);
    }

    // Perform NMS by class.
    for (int k = 1; k < CLASS_NUM; k++){
        int current_item = 0;
        sortClassboxlist(classboxlist, k);
        // If current data is invalid, skip it.
        if (get<3>(classboxlist[k][0]))
            continue;

        // Obtain the top 2 (TOP_N_INCLASS) bounding boxes for each class and store in classresultlist.
        classresultlist[k * TOP_N_INCLASS + 0] = classboxlist[k][current_item];
        for (int l = 0; l < TOP_N_INCLASS; l++){
            if (current_item >= RESULT_NUM)
                break;
            // Perform non-maximum suppression and get the next item to be output.
            int next_item = NMS_byclass(classboxlist[k],invalidindexes,k,current_item,boxdata);
            classresultlist[k * TOP_N_INCLASS + l] = classboxlist[k][current_item];
            // No more valid output.
            if (next_item < 0)
                break;
            current_item = next_item;
        }
    }

    // Squeeze classresultlist, remove NULL items.
    int rescnt = 0;
    for (int i = 0; i < ALL_RESULT_SIZE; i++){
        if (classresultlist[i] !=  make_tuple(-1, -1, -1.0, false) ){
            classresultlist[rescnt] = classresultlist[i];
            rescnt++;
        }
    }
    classresultlist.resize(rescnt);
    // Sort the classresultlist in descending order, max confidence first.
    sort(classresultlist.begin(), classresultlist.end(), resultbox_compare);
    int outputsize = 0;
    if (rescnt > TOP_N_RESULT)
        outputsize = TOP_N_RESULT;
    else
        outputsize = rescnt;

    // Draw bounding boxes.
    for (int i = 0; i < outputsize; i++){
        auto pclassbox = classresultlist[i];
        if (pclassbox == make_tuple(-1, -1, -1.0, false))
            continue;
        int current_item = get<0>(pclassbox);
        if (get<3>(pclassbox) == false && get<1>(pclassbox) != 20 && invalidindexes[current_item] == false){
            if (current_item < 0 || current_item > RESULT_NUM) 
                cout << "Something wrong" << endl;
            // Obtain the (x,y) coordinates, width, and height to draw the box and display its corresponding class and confidence
            vector<int> framedata;
            framedata.push_back(static_cast<int>(get<0>(boxdata[current_item]) * 300));
            framedata.push_back(static_cast<int>(get<1>(boxdata[current_item]) * 300));
            framedata.push_back(static_cast<int>((get<0>(boxdata[current_item]) + get<2>(boxdata[current_item])) * 300));
            framedata.push_back(static_cast<int>((get<1>(boxdata[current_item]) + get<3>(boxdata[current_item])) * 300));
            rectangle(img_RGB, Point(framedata[0], framedata[1]), Point(framedata[2], framedata[3]),Scalar(0, 0, 255), 2);
            string label_str = labels[get<1>(pclassbox)];
            //printf("pclassbox element 2: %f", get<2>(pclassbox));
            string return_msg = label_str + ": " + to_string(round(get<2>(pclassbox)));
            putText(img_RGB, return_msg, Point(framedata[0], framedata[1]+20), FONT_HERSHEY_SIMPLEX, 1, Scalar(0, 0, 255), 2);
            cout << return_msg << endl;

        }
    }


    //show the image
    imshow("Image", img_RGB); 
    waitKey(0); // wait for a keyboard event
    destroyWindow("Image"); // then destroy the window and release resources
    return 0;
}